import React from 'react';

const HomeContent = () => {
    return (
        <div className="flex justify-center items-center h-full bg-gray-50">
            <div className="max-w-xl p-6 bg-white shadow-lg rounded-lg">
                <h1 className="text-4xl font-bold text-gray-800 mb-4">Makeup Remover</h1>
                <p className="text-xl text-gray-600 mb-6">~See Your True Beauty Unveiled</p>
                
                <div className="bg-blue-100 p-4 rounded-lg">
                    <p className="text-lg text-gray-700 mb-4">Ready to Unveil Your True Self?</p>
                    <button className="bg-blue-500 text-white px-6 py-3 rounded hover:bg-blue-400 transition-colors duration-300">
                        Get Started Now
                    </button>
                </div>
            </div>
        </div>
    );
};

export default HomeContent;
